lyrics:
What was thaas? Fog was whaas? Too mult sleepth. Let sleepth.
But really now whenabouts? Expatiate then how much times we live in. Yes?
So, nat by night by naught by naket, in those good old lousy days gone by, the days, shall we say? of Whom shall we say? while kinderwardens minded their twinsbed, therenow they-stood, the sycomores, all four of them, in their quartan agues, the majorchy, the minorchy, the everso and the fermentarian with their ballyhooric blowreaper, titranicht by tetranoxst, at their pussycorners, and that old time pallyollogass, playing copers fear-some, with Gus Walker, the cuddy, and his poor old dying boosy cough, esker, newcsle, saggard, crumlin, dell me, donk, the way to wumblin. Follow me beeline and you’re bumblin, esker, newcsle, saggard, crumlin. And listening. So gladdied up when nicechild Kevin Mary (who was going to be comman-deering chief of the choirboys’ brigade the moment he grew up under all the auspices) irishsmiled in his milky way of cream dwibble and onage tustard and dessed tabbage, frighted out when badbrat Jerry Godolphing (who was hurrying to be cardinal scullion in a night refuge as bald as he was cured enough unerr all the hospitals) furrinfrowned down his wrinkly waste of methylated spirits, ick, and lemoncholy lees, ick, and pulverised rhubarbarorum, icky;
night by silentsailing night while infantina Isobel (who will be blushing all day to be, when she growed up one Sunday, Saint Holy and Saint Ivory, when she took the veil, the beautiful presentation nun, so barely twenty, in her pure coif, sister Isobel, and next Sunday, Mistlemas, when she looked a peach, the beautiful Samaritan, still as beautiful and still in her teens, nurse Saintette Isabelle, with stiffstarched cuffs but on Holiday, Christmas, Easter mornings when she wore a wreath, the wonderful widow of eighteen springs, Madame Isa Veuve La Belle, so sad but lucksome in her boyblue’s long black with orange blossoming weeper’s veil) for she was the only girl they loved, as she is the queenly pearl you prize, because of the way the night that first we met she is bound to be, methinks, and not in vain, the darling of my heart, sleeping in her april cot, within her singachamer, with her greengageflavoured candywhistle duetted to the crazyquilt, Isobel, she is so pretty, truth to tell, wildwood’s eyes and primarose hair, quietly, all the woods so wild, in mauves of moss and daphnedews, how all so still she lay, neath of the whitethorn, child of tree, like some losthappy leaf, like blowing flower stilled, as fain would she anon, for soon again ’twill be, win me, woo me, wed me, ah weary me! deeply, now evencalm lay sleeping;
nowth upon nacht, while in his tumbril Wachtman Havelook seequeerscenes, from yonsides of the choppy, punkt by his curserbog, went long the grassgross bumpinstrass that henders the pubbel to pass, stowing his bottle in a hole for at whet his whuskle to stretch ecrooksman, sequestering for lovers’ lost pro-pertied offices the leavethings from allpurgers’ night, og gneiss ogas gnasty, kikkers, brillers, knappers and bands, handsboon and strumpers, sminkysticks and eddiketsflaskers;
wan fine night and the next fine night and last find night while Kothereen the Slop in her native’s chambercushy, with dreamings of simmering my veal astore, was basquing to her pillasleep how she thawght a knogg came to the dowanstairs dour at that howr to peirce the yare and dowandshe went, schritt be schratt, to see was it Schweeps’s mingerals or Shuhorn the posth with a tilly- cramp for Hemself and Co, Esquara, or them four hoarsemen on their apolkaloops, Norreys, Soothbys, Yates and Welks, and, galorybit of the sanes in hevel, there was a crick up the stirkiss and when she ruz the cankle to see, galohery, downand she went on her knees to blessersef that were knogging together like milk-juggles as if it was the wrake of the hapspurus or old Kong Gander O’Toole of the Mountains or his googoo goosth she seein, sliving off over the sawdust lobby out ofthe backroom, wan ter, that was everywans in turruns, in his honeymoon trim, holding up his fingerhals, with the clookey in his fisstball, tocher of davy’s, tocher of ivileagh, for her to whisht, you sowbelly, and the whites of his pious eyebulbs swering her to silence and coort;
each and every juridical sessions night, whenas goodmen twelve and true at fox and geese in their numbered habitations tried old wireless over boord in their juremembers, whereas by reverendum they found him guilty of their and those imputations of fornicolopulation with two of his albowcrural correlations on whom he was said to have enjoyed by anticipation when schooling them in amown, mid grass, she sat, when man was, amazingly frank, for their first conjugation whose colours at standing up from the above were of a pretty carnation but, if really ’twere not so, of some deretane denudation with intent to excitation, caused by his retrogradation, among firearmed forces proper to this nation but apart from all titillation which, he said, was under heat pressure and a good mitigation without which in any case he insists upon being worthy of continued alimentation for him having displayed, he says, such grand toleration, reprobate so noted and all, as he was, with his washleather sweeds and his smokingstump, for denying transubstantiation nevertheless in respect of his highpowered station, whereof more especially as probably he was meantime suffering genteel tortures from the best medical attestation, as he oftentimes did, having only strength enough, by way of festination, to implore (or I believe you have might have said better) to complore, with complete obsecration, on everybody connected with him the curse of co-agulation for, he tells me outside Sammon’s in King Street, after two or three hours of close confabulation, by this pewterpint of Gilbey’s goatswhey which is his prime consolation, albeit involving upon the same no uncertain amount of esophagous re — gurgitation, he being personally unpreoccupied to the extent of a flea’s gizzard anent eructation, if he was still extremely offen-sive to a score and four nostrils’ dilatation, still he was likewise, on the other side of him, for some nepmen’s eyes a delectation, as he asserts without the least alienation, so prays of his faullt you would make obliteration but for our friend behind the bars, though like Adam Findlater, a man of estimation, summing him up to be done, be what will of excess his exaltation, still we think with Sully there can be no right extinuation for contravention of common and statute legislation for which the fit remedy resides, for Mr Sully, in corporal amputation: so three months for Gubbs Jeroboam, the frothwhiskered pest of the park, as per act one, section two, schedule three, clause four of the fifth of King Jark, this sentence to be carried out tomorrowmorn by Nolans Volans at six o’clock shark, and may the yeastwind and the hoppinghail malt mercy on his seven honeymeads and his hurlyburlygrowth, Amen, says the Clarke;
niece by nice by neat by natty, whilst amongst revery’s happy gardens nine with twenty Leixlip yearlings, darters all, had such a ripping time with gleeful cries of what is nice toppingshaun made of made for and weeping like fun, him to be gone, for they were never happier, huhu, than when they were miserable, haha;
in their bed of trial, on the bolster of hardship, by the glimmer of memory, under coverlets of cowardice, Albatrus Nyanzer with Victa Nyanza, his mace of might mortified, her beautifell hung up on a nail, he, Mr of our fathers, she, our moddereen ru arue rue, they, ay, by the hodypoker and blazier, they are, as sure as dinny drops into the dyke . . .
A cry off.
Where are we at all? and whenabouts in the name of space?
I don’t understand. I fail to say. I dearsee you too.
House of the cederbalm of mead. Garth of Fyon. Scene and property plot. Stagemanager’s prompt. Interior of dwelling on out- skirts of city. Groove two. Chamber scene. Boxed. Ordinary bed-room set. Salmonpapered walls. Back, empty Irish grate, Adam’s mantel, with wilting elopement fan, soot and tinsel, condemned. North, wall with window practicable. Argentine in casement Vamp. Pelmit above. No curtains. Blind drawn. South, party wall Bed for two with strawberry bedspread, wickerworker clubsessel and caneseated millikinstool. Bookshrine without, facetowel upon. Chair for one. Woman’s garments on chair. Man’s trousers with crossbelt braces, collar on bedknob. Man’s corduroy surcoat with tabrets and taces, seapan nacre buttons on nail. Woman’s gown on ditto. Over mantelpiece picture of Michael, lance, slaying Satan, dragon with smoke. Small table near bed, front. Bed with bedding. Spare. Flagpatch quilt. Yverdown design. Limes. Lighted lamp without globe, scarf, gazette, tumbler, quantity of water, julepot, ticker, side props, eventuals, man’s gummy article, pink.
A time.
Act: dumbshow.
Closeup. Leads.
